import React from 'react';
import './styles.scss';


export default function RegistrationSuccesful() {

function  handleRouteLog(){ 
    window.location.href="login";
  } 

  return(
<div className="container-success">
  <h1>Congratulations!! your registration was successful.</h1>
  <p>Welcome to TransportWise.</p>
  <br />
  <button type="submit" className="btnAll" onClick={handleRoutLog}>Register</button>
</div>
);
}
